\t\t \n\t\t\t \n\t\t\t\t\t\t\t\t \n\t\t\t\t \n\t\t\t Turkish Çilbir. The Perfect Start To The Day \t\t\n\t\t\t\t\n\t\t\t\t\t\n\t\t\n\t\t\t\t\t\t\t\n\t\t\n\t\t\t\t \n\t\t\t\t\t\t \n\t\t\t\t\t \n\t\t\t \n\t\t\t\t\t\t\t\t \n\t\t\t\t \n\t\t\t \t\t\t\t This quick, simple breakfast ticks all the boxes for a delicious start to the day or lunch. This dish is based on Turkish Çilbir, a spiced yogurt dish. This is my take on that dish with a twist. Please enjoy.\t\t\t\t\t\t\n\t\t\t\t\n\t\t\t\t\t\n\t\t\n\t\t\t\t\t\t\t\n\t\t\n\t\t \n\t\t\t\t\t \n\t\t\t\t \n\t\t\t\t \n\t\t\t \n\t \n\t \n\t\t Turkish Çilbir\n\t\t\n\t\t\n\t\t\n\t\t\n\t\n\n \n\t\t  Print Recipe\n\t\t  Pin Recipe\n 5 from 1 vote\n\t\t\t\t\n\t\t\n\t\t\n\n Prep Time: 10 minutes minutes Cook Time: 10 minutes minutes Total Time: 20 minutes minutes\n\n Servings: 2 People\n Calories: 299kcal\n Author: Chef Jack Ovens\n\n\n 1x2x3x\n Ingredients   1 - Whole Bulb Garlic 2 ½ Tbsp (50g) -  Natural Greek Yogurt 1 - Garlic Clove, Minced ¼ - Lemon, Zested ¼ - Lime, Zest ¼ - Lemon, Juiced 3 Tbsp (42g) -  Butter 1 ½ tsp (4g) -  Smoked Paprika ½ (2g) -  Dried Chilli Flakes 3 tsp (15ml) -  White Vinegar 2-4 - Free Range Eggs 1 ½ tsp (7.5ml) -  Extra Virgin Olive Oil (Optional) Brioche Bread Or Bread Of Choice, Lightly Toasted Seasoning To Taste Dill To Garnish Parsley To Garnish\n Instructions Preheat oven to 180.c - 350.f. Place the whole garlic bulb onto a sheet of aluminium foil, drizzle over the oil, fold into a parcel, and roast in the oven for 45 minutes or until soft and tender. Remove and let cool slightly.  Place a small pan over medium heat; add the butter, smoked paprika, chilli flakes and seasoning to taste. Melt and cook for 2 minutes. Remove and set aside.  In the meantime, prepare the citrus yogurt sauce by placing the yogurt into a bowl, adding the minced garlic, lemon and lime zest, lemon juice and seasoning to taste.  Bring a saucepan of water over high heat, add the vinegar and bring to a boil. Poach the eggs for 2 1/2 minutes or until done to your liking. Remove and drain on a paper towel.  Toast the bread to your liking, and spread with the roasted garlic and citrus yogurt dressing. Add the poached eggs and drizzle with the smoked paprika and chilli butter. Garnish with dill, parsley and cracked black pepper. \n Nutrition Guide \n\t \n\t Nutrition Facts Turkish Çilbir Amount per Serving Calories 299 % Daily Value* Fat   25 g 38 % Saturated Fat   13 g 81 % Trans Fat   1 g Polyunsaturated Fat   2 g Monounsaturated Fat   9 g Cholesterol   232 mg 77 % Sodium   236 mg 10 % Potassium   245 mg 7 % Carbohydrates   9 g 3 % Fiber   2 g 8 % Sugar   2 g 2 % Protein   11 g 22 % Vitamin A   2081 IU 42 % Vitamin C   8 mg 10 % Calcium   99 mg 10 % Iron   2 mg 11 % * Percent Daily Values are based on a 2000 calorie diet.\n\n\n\n\n \n\n  Like this recipe?Leave a comment below  \t\t\n\t\t\t\t\n\t\t\t\t\t\n\t\t\t\t\n\t\t\t\t \n\t\t\t\t\t\t \n\t\t\t\t\t \n\t\t\t \n\t\t\t\t\t\t\t\t \n\t\t\t\t \n\t\t\t\t\t\t\t The above nutrition guide is based on daily averages and is calculated for a single portion. \t\t\t\t\t\t\n\t\t\t\t\n\t\t\t\t\t\n\t\t\n\t\t\t\t\t\t\t\n\t\t\n\t\t \n\t\t\t\t\t \n\t\t\t\t \n\t\t\t\t \n\t\t\t \t\t \n\t\t\t \n\t\t\n\t\t\t\t\n\t\t\t\t\n\t\t\t\t\t\n\t\t\t\t\n\t\t\t\t \n\t\t\t\t\t\t \n\t\t\t\t\t \n\t\t\t \n\t\t\t\t\t\t\t\t \n\t\t\t\t \n\t\t\t Recipe Notes\t\t\n\t\t\t\t\n\t\t\t\t\t\n\t\t\n\t\t\t\t\t\t\t\n\t\t\n\t\t \n\t\t\t\t\t \n\t\t\t\t \n\t\t\t\t \n\t\t\t\t\t \n\t\t\t \n\t\t\n\t\t\t\t\n\t\t\t\t\n\t\t\t\t\t\n\t\t\t\t\n\t\t \n\t\t\t\t\t \n\t\t\t\t \n\t\t\t\t \n\t\t\t Turkish Çilbir Storage & Reheating Instructions\t\t\n\t\t\t\t\n\t\t\t\t\t\n\t\t\t\t\n\t\t \n\t\t\t\t\t \n\t\t\t\t \n\t\t\t\t \n\t\t\t\t\t\t\t This recipe is not recommended for storage and reheating and is best eaten fresh. If you do try to store and reheat, the dish will be soggy and the eggs will be dry. \t\t\t\t\t\t\n\t\t\t\t\n\t\t\t\t\t\n\t\t\t\t\n\t\t \n\t\t\t\t\t \n\t\t\t\t \n\t\t\t\t \n\t\t\t\t\t \n\t\t\t \n\t\